现在请仅输出严格 JSON，必须完全匹配以下结构（键名、层级、字段齐全），所有数值用数字表示（保留2-3位小数），布尔用 true/false，字符串填写说明文字。不要输出任何解释文字或前后缀，也不要多余字段；若无法计算某值请给出可解析的近似值。

{
  "(1) 结论": "[字符串]",
  "(2) VBM/CBM 信息": {
    "Evbm": "[字符串]",
    "VBM_k_index": "[字符串]",
    "k_vbm": "[字符串]",
    "Ecbm": "[字符串]",
    "CBM_k_index": "[字符串]",
    "k_cbm": "[字符串]"
  },
  "(3) 带隙与Δk": {
    "Eg": "[字符串]",
    "Delta_k": "[字符串]"
  },
  "(4) 能带图路径": "[字符串]",
  "(5) 光学量": {
    "吸收边波长_lambda": "[字符串]",
    "激子结合能_Eb_eV": "[字符串]",
    "激子结合能_Eb_meV": "[字符串]",
    "跃迁类型说明": "[字符串]"
  },
  "(6) 数据库交叉核验": {
    "状态": "[字符串]",
    "数据库带隙": "[字符串]",
    "差值": "[字符串]",
    "容差判定(±0.200 eV)": "[字符串]",
    "原因": "[字符串]"
  },
  "(7) 相似材料统计与图": {
    "n_direct": "[数值]",
    "n_indirect": "[数值]",
    "avg_bandgap": "[字符串]",
    "total": "[数值]",
    "comparison_figure_path": "[字符串]"
  },
  "复现实验/数值核对说明": "[数学方程字符串]"
}

